import React from 'react';
import './index.css';
function Card(props)
{
    return(
        <> <div className="cards">
        <div className="card">
        <h1>  {props.id}</h1>
            
            <img src={props.imgsrc} className='card_img'/>
            <div className="card_info">
            
            <span className='card_category'>{props.title}</span>
            <h3 className='card_title'>Name: {props.brand_name} </h3>
            <h4 className='card_price'>Price: {props.price} pkr </h4>
            <a href={props.product_link} target='_blank' >
                <button>Watch now</button>
            </a>    
            </div>
        </div>
    </div>
    </>    )
}

export default Card;
